import { Link } from "react-router-dom";

export default function UsersProp(props) {
    return (
        <div>
            <p>{props.fname}</p>
            <p>{props.lname}</p>
            <p>{props.username}</p>
            <Link to={`/usershow/${props.id}`}>
                <button variant="contained" color="primary">
                    Show
                </button>
            </Link>
        </div>
    )
}
